import './index.css';

const App = () => {
  const height = window.innerHeight;

  return (
    <section className="App" style={{ height: height }}>

      <iframe width="600" height="400" src="https://data.gov.sg/dataset/carpark-availability/resource/4f4a57d1-e904-4326-b83e-dae99358edf9/view/f89b0f89-4760-45a0-af61-30b1e27d0fc3" frameBorder="0"> </iframe>
    </section>
  );
}

export default App;
